import React from "react";
import banner from "../assets/img/bank-tree.jpeg";

const Banner = () => {
  return (
    <main>
      <div className="banner">
        <img className="banner-img" src={banner} alt="Banniére du site" />
        <div>
          <h1>Pas de frais. Aucun dépôt minimum. Taux d'intérêt élevés.</h1>
        </div>
      </div>
    </main>
  );
};

export default Banner;
